	add("stretching", "{\"term\":\"stretching\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"English\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act by which something is stretched\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1859\u0027\u0027, Victor Regnault, \u0027Elements of Chemistry\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Skins] must be submitted to several washings, treadings, and \u0027\u0027stretchings\u0027\u0027, before they acquire the necessary pliancy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A form of physical exercise in which a specific skeletal muscle (or muscle group) is deliberately elongated to its fullest length in order to improve the muscle\u0027s felt elasticity and reaffirm comfortable muscle tone\", \"priority\":4}]}, \"synonyms\":{}}");

