	add("stricture", "{\"term\":\"stricture\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027strict≈´ra\u0027 from Latin \u0027strictus\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a rule restricting behaviour or actio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"For them, parity is less an ultimate goal than a transitory and permissive springboard for testing Western resolve and pursuing whatever additional accretions of strategic power the \u0027\u0027strictures\u0027\u0027 of SALT and American tolerance will allow\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a sternly critical remark or revie\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"abnormal narrowing of a canal or duct in the bod\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"strictnes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A man of \u0027\u0027stricture\u0027\u0027 and firm abstinence.\u0027 \u0026amp;mdash; Shakespeare\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a stroke; a glance; a touc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the degree of contact, in consonants\", \"priority\":8}]}, \"synonyms\":{}}");

	add("strides", "{\"term\":\"strides\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Trousers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Marion Houldsworth, \u0027Red Dust Rising: The Story of Ray Fryer of Urapunga\u0027, Central Queensland University Press, 2011, Boolarong Press, [http://books.google.com.au/books?id\u003deNbeliKr-rcC\u0026amp;pg\u003dPA97\u0026amp;lpg\u003dPA97\u0026amp;dq\u003d%22pair+of+strides%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dagkGMgDld_\u0026amp;sig\u003dl8miF27D_YUzHZmJx2GTbzIrYNM\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnSVoUJqDKcSTiAek6IDQDw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pair%20of%20strides%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 97\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"So he gave him one boot. I said, ‚ÄòOne boot‚Ä≤s no bloody good! Give him two boot[s]!‚Äô So he chucks over another boot, and a pair of \u0027\u0027strides\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Smiley Brymer, \u0027The Universal Naked Linesman\u0027, AuthorHouse, [http://books.google.com.au/books?id\u003dJsxT6LB3LZkC\u0026amp;pg\u003dPA173\u0026amp;lpg\u003dPA173\u0026amp;dq\u003d%22pair+of+strides%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dXtGE3-kVED\u0026amp;sig\u003dg_c0h7LIktb5J6ehh8Pms13PJAw\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnSVoUJqDKcSTiAek6IDQDw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pair%20of%20strides%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 173\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He went upstairs and changed into a fresh pair of \u0027\u0027strides\u0027\u0027, nipped into the bathroom and gave his hands and face a quick rinse and threw on a clean pullover\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Antony Agar, \u0027Queensland Ringer\u0027, [http://books.google.com.au/books?id\u003dkXVB1ODvS1cC\u0026amp;pg\u003dPA211\u0026amp;lpg\u003dPA211\u0026amp;dq\u003d%22pair+of+strides%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dvhAUSix2xq\u0026amp;sig\u003drDejuCZ_v-p3luqs5s09PbIDnR0\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnSVoUJqDKcSTiAek6IDQDw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pair%20of%20strides%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 211\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"His mother used to have to buy two pair of \u0027\u0027strides\u0027\u0027 for him, cut the legs off one and sew them onto the other\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, w:Irvine Irvine Welsh, \u0027w:The Acid The Acid House\u0027, 2008, [http://books.google.com.au/books?id\u003dimsi-7Av2R4C\u0026amp;pg\u003dPT242\u0026amp;lpg\u003dPT242\u0026amp;dq\u003d%22pair+of+strides%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dMYlyiIN9cB\u0026amp;sig\u003dwzoXVcLoENNJ4tWcNP5zIJUwexM\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnSVoUJqDKcSTiAek6IDQDw\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pair%20of%20strides%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"I thought of Des and May‚Ä≤s daughters, then of Gleaves, and resolved to borrow a pair of \u0027\u0027strides\u0027\u0027 from Cliff, to keep the tie-wearing penile-challenged toss-bag oaf ma case\", \"priority\":13}]}, \"synonyms\":{}}");

	add("stridor", "{\"term\":\"stridor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027strƒ´dor\u0027 (shrill or harsh sound) from \u0027strƒ´d≈ç\u0027 (make a shrill or harsh sound)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A harsh, shrill, unpleasant noise\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027 \u0027But when the tilted plank let slide its freight into the sea, a second strange human murmur was heard, blended now with another inarticulate sound proceeding from certain larger sea-fowl, whose attention having been attracted by the peculiar commotion in the water resulting from the heavy sloped dive of the shotted hammock into the sea, flew screaming to the spot. So near the hull did they come, that the \u0027\u0027stridor\u0027\u0027 or bony creak of their gaunt double-jointed pinions was audible.\u0027 Herman Melville, \u0027Billy Budd\u0027, [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dtext\u0026amp;offset\u003d475499599\u0026amp;textreg\u003d2\u0026amp;query\u003dstridor\u0026amp;id\u003dMelBill Chapter 28\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A high-pitched sound heard on inspiration resulting from turbulent air flow in the upper airway usually indicative of serious airway obstruction\", \"priority\":3}]}, \"synonyms\":{}}");

	add("strife", "{\"term\":\"strife\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"frankish\", \"old french (842-ca. 1400)\", \"Proto-Germanic\"], \"text\":\"From Old french (842-ca. 1400) \u0027estrif\u0027 from Frankish \u0027\u0027 (strƒ´ban) ultimately of Proto-germanic origin, compare German \u0027streit\u0027 (quarrel, dispute) and Icelandic \u0027str√≠√∞\u0027 (war) and Dutch strijd.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Conflict, sometimes violent, usually brief or limited in scope\", \"priority\":1}]}, \"synonyms\":{}}");

	add("strigolactone", "{\"term\":\"strigolactone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027striga\u0027 + \u0027lactone\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a family of terpenoid lactones that stimulate germination in parasitic plants of the genus \u0027Striga\u0027, and that inhibit shoot branching\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Christine A. Beveridge, Catherine Rameau, \u0027E2A: \u0027\u0027Strigolactones\u0027\u0027: The New Class of Branching Hormones\u0027, Peter J. Davies (editor), \u0027Plant Hormones: Biosynthesis, Signal Transduction, Action!\u0027, [http://books.google.com.au/books?id\u003dE8LXjxtd5H4C\u0026amp;pg\u003dPA513\u0026amp;dq\u003d%22strigolactone%22%7C%22strigolactones%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbieCUt2uIYn6kAW56IGgDg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22strigolactone%22%7C%22strigolactones%22\u0026amp;f\u003dfalse page 513\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Orthologous \u0027\u0027strigolactone\u0027\u0027 response mutants (\u0027max2\u0027/\u0027ore9\u0027 in Arabidopsis, \u0027rms4\u0027 in pea, \u0027d3\u0027 in rice) have been of major value to demonstrate the specificity of action of \u0027\u0027strigolactones\u0027\u0027 (13, 22\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Vivienne Gianinazzi-Pearson, Marie Tollot, Pascale M. A. Seddas, \u0027Chapter 3: Dissection of Genetic Cell Programmes Driving Early Arbuscular Mycorrhiza Iteractions\u0027, C. Azc√≥n Aguilar, J. M. Barea, S. Gianinazzi, V. Gianinazzi-Pearson (editors), \u0027Mycorrhizas - Functional Processes and Ecological Impact\u0027, [http://books.google.com.au/books?id\u003disu1QGHvZiQC\u0026amp;pg\u003dPA36\u0026amp;dq\u003d%22strigolactone%22%7C%22strigolactones%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbieCUt2uIYn6kAW56IGgDg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22strigolactone%22%7C%22strigolactones%22\u0026amp;f\u003dfalse page 36\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Strigolactones\u0027\u0027 are produced by the non-mycorrhizal plant \u0027Arabidopsis thaliana\u0027 (Westwood 2000; Goldwasser and Yoder 2001), and plant mutants defective for \u0027\u0027strigolactone\u0027\u0027 production have not yet been obtained\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, J. Benjamin Miller, Giles E. D. Oldroyd, \u0027The Role of Diffusible Signals in the Establishment of Rhizobial and Micorrhizal Symbioses\u0027, Silvia Perotto, F. Balu≈°ka (editors), \u0027Signaling and Communication in Plant Symbiosis\u0027, [http://books.google.com.au/books?id\u003dzvyQtadiA2QC\u0026amp;pg\u003dPA15\u0026amp;dq\u003d%22strigolactone%22%7C%22strigolactones%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dbieCUt2uIYn6kAW56IGgDg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22strigolactone%22%7C%22strigolactones%22\u0026amp;f\u003dfalse page 15\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The first \u0027\u0027strigolactone\u0027\u0027 isolated from root exudates was strigol (Cook et al. 1966\", \"priority\":10}]}, \"synonyms\":{}}");

	add("strikee", "{\"term\":\"strikee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|strike|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The recipient of a strike, especially a physical blow; one who has been struck\", \"priority\":1}]}, \"synonyms\":{}}");

	add("striker", "{\"term\":\"striker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|strike|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An individual who is on strike\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone or something that hits someone or something else\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A blacksmith\u0027s assistant who wields the sledgehammer\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One of the players on a team in football (soccer) in the row nearest to the opposing team\u0027s goal, who are therefore principally responsible for scoring goals\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An officer\u0027s servant or orderly\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The batter\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The batsman who is currently facing the bowler and defending his wicket\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A harpoon\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A harpooner\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Wherever we come to an anchor, we always send out our \u0027\u0027strikers\u0027\u0027, and put out hooks and lines overboard, to try fish.\u0027 \u0026amp;mdash; Dampier\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A wencher; a lewd man\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A blackmailer in politics\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"One whose political influence can be bought\", \"priority\":13}]}, \"synonyms\":{}}");

