	add("structure", "{\"term\":\"structure\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027lang\u003dfrm\u0027 from Latin \u0027structura\u0027 (a fitting together, adjustment, building, erection, a building, edifice, structure) from \u0027\u0027 past participle \u0027structus\u0027 () Compare construct, instruct, destroy, etc.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cohesive whole built up of distinct parts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe original family who had begun to build a palace to rival Nonesuch had died out before they had put up little more than the gateway, so that the actual \u0027\u0027structure\u0027\u0027 which had come down to posterity retained the secret magic of a promise rather than the overpowering splendour of a great architectural achievement\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The birds had built an amazing \u0027\u0027structure\u0027\u0027 out of sticks and various discarded items\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The underlying shape of a solid\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He studied the \u0027\u0027structure\u0027\u0027 of her face\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The overall form or organization of something\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027structure\u0027\u0027 of a sentence\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027structure\u0027\u0027 of the society was still a mystery\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A set of rules defining behaviour\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"For some, the \u0027\u0027structure\u0027\u0027 of school life was oppressive\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; Several pieces of data treated as a unit\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"This \u0027\u0027structure\u0027\u0027 contains both date and timezone information\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; Underwater terrain or objects (such as a dead tree or a submerged car) that tend to attract fis\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"There\u0027s lots of \u0027\u0027structure\u0027\u0027 to be fished along the west shore of the lake; the impoundment submerged a town there when it was built\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A body, such as a political party, with a cohesive purpose or outlook\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The South African leader went off to consult with the \u0027\u0027structures\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"amp;nbsp; A set along with a collection of finitary functions and relations\", \"priority\":17}]}, \"synonyms\":{}}");

